  true,\n\t\"url\": null,\n\t\"notes\": \"<p>For the quarter beginning with January
  1, 2014, states began reporting Medicaid enrollment data as part of their Medicaid
  expenditure reporting through the Medicaid Budget and Expenditure System (MBES).
  The enrollment information is a state-reported count of unduplicated individuals
  enrolled in the states Medicaid program at any time during each month in the quarterly
  reporting period.  The enrollment data identifies the total number of Medicaid enrollees
  and, for states that have expanded Medicaid, provides specific counts for the number
  of individuals enrolled in the new adult eligibility group, also referred to as
  the VIII Group. Reports linked on this page include state-by-state data for this
  population as well as a count of individuals whom the state has determined are newly
  eligible for Medicaid.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
